import React from "react";
import "../css/header.css";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <nav className="navbar bg-body-tertiary fixed-top">
      <div className="container-fluid">
        <Link></Link>
      </div>
    </nav>
  );
}
